import React from "react";
import Navbar from 'react-bootstrap/Navbar'

export default function Nav() {
  return (
    <div className="navBar">
        <Navbar className="navBar">
          <Navbar.Brand href="#home">Brand link</Navbar.Brand>
        </Navbar>
    </div>
  );
}
